import React from 'react';
import ProductCard from '../components/ProductCard';

const HomePage = () => {
  return (
    <div>
      <h1>Home Page</h1>
      {/* 임시로 3개의 ProductCard 컴포넌트 렌더링 */}
      <div style={{ display: 'flex', gap: '20px' }}>
        <ProductCard />
        <ProductCard />
        <ProductCard />
      </div>
    </div>
  );
};

export default HomePage;
